import React from 'react';
import { Pie, Tooltip, Legend, PieChart, ResponsiveContainer } from 'recharts';
import { colors, headers } from 'styles';
import { View, Text } from 'react-native';

export default function PieChartComponent({ data }) {
    return (
        <View style={{ width: '100%', height: '30%', backgroundColor: colors.background(10) }}>
            <Text style={[headers.H2(colors.lightText(), 'Light'), { marginTop: 100, textAlign: 'center' }]}>
                Total subscriptions for each of your created workout plans
            </Text>
            <ResponsiveContainer>
                <PieChart>
                    <Pie isAnimationActive={true} dataKey={'value'} data={data} fill={colors.themeSecoundary(50)} label />
                    <Tooltip />
                </PieChart>
            </ResponsiveContainer>
        </View>
    );
}
